description:
What I Did on My Vacation is an official compilation album from Ian Gillan, released in 1986 in UK by 10 Records. The album covers Gillan's recordings between 1976 and 1982 and was made available in three formats: on vinyl as a double album, as a single CD and a cassette. All songs from the album had been previously released. Although not credited on the cover, &quot;Scarabus&quot; is preceded by an instrumental piece by Colin Towns, which was used as the intro to &quot;On The Rocks&quot; (from the &quot;Glory Road&quot; album).

